import React from 'react';

function HowWeWork() {
  return (
    <section id="how-we-work">
      <h2>How We Work</h2>
      <ol>
        <li>Consultation</li>
        <li>Design</li>
        <li>Implementation</li>
        <li>Delivery</li>
      </ol>
    </section>
  );
}

export default HowWeWork;
